import React, { useEffect, useState } from 'react';

const TeamPage = () => {
    const [team, setTeam] = useState([]);

    useEffect(() => {
        const fetchTeamInfo = async () => {
            // Mock данные для команды
            const data = [
                {
                    name: "Тихонова Виктория",
                    role: "Контролёр",
                    photo: "/vika.jpg"
                },
                {
                    name: "Купинская Дарья",
                    role: "Координатор",
                    photo: "/dasha.jpg"
                },
                {
                    name: "Тен Алина",
                    role: "Исследователь ресурсов",
                    photo: "/10.jpg"
                },
                {
                    name: "Снигур Анастасия",
                    role: "Генератор идей",
                    photo: "/snigur.jpg"
                },
                {
                    name: "Постных Василий",
                    role: "Вдохновитель",
                    photo: "/ya.jpg"
                },
                {
                    name: "Данилова Екатерина",
                    role: "Реализатор",
                    photo: "/katya.jpg"
                },
            ];
            setTeam(data);
        };
        fetchTeamInfo();
    }, []);

    return (
        <div>
            <h1>Наша команда</h1>
            <div className="team-container">
                {team.map((member, index) => (
                    <div key={index} className="team-card">
                        <img src={member.photo} alt={member.name} className="team-photo" />
                        <h3>{member.name}</h3>
                        <p><strong>Роль:</strong> {member.role}</p>
                    </div>
                ))}
            </div>
        </div>
    );
};

export default TeamPage;
